import React from "react";

const ItineraryCard = ({ itinerary }) => {
  return (
    <div className="bg-white p-4 rounded shadow">
      <h2 className="text-lg font-bold">{itinerary.title}</h2>
      <p>{itinerary.details}</p>
    </div>
  );
};

export default ItineraryCard;
